	/**
	 * check two vector whitch contain string object,
	 * check if a string is both in the first vector and
	 * the second vector
	 * @param v1 the vector containning strings
	 * @param v2 the vector containning strings
	 */
    private String is_there_has_a_same_string(Vector v1,Vector v2) {
		
		Enumeration seq1=v1.elements(); 
		Enumeration seq2; 
		String s1,s2;
	
		while(seq1.hasMoreElements()) {
			s1 = (String)seq1.nextElement();
			seq2=v2.elements();
			while(seq2.hasMoreElements()) {
				s2 = (String)seq2.nextElement();
				if(s1.compareTo(s2) == 0){
					return s1;
				}
			
		    }
			
		}
		return null;
		
	}

	
